// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";

contract MedicalRecords is Ownable {
    struct MedicalRecord {
        // IPFS CIDs
        string[] cids;
        // Patient
        string patientName;
        uint8 patientAge;
        string patientGender;
        // Summary
        string[] conditions;
        string[] allergies;
        string[] medications;
        // Vitals
        string bloodPressure;
        string heartRate;
        string temperature;
        // Recent Visit
        string recentVisitDate;
        string visitReason;
        string visitNotes;
        // Lab Result
        string labTestName;
        string labResultData;
        string labDate;
        // Prescription
        string prescriptionName;
        string prescriptionDosage;
        string prescribedDate;
        // Next Appointment (optional—empty strings if none)
        string nextAppointmentDate;
        string nextAppointmentDoctor;
        // Access control & owner
        address owner;
        mapping(address => uint256) accessExpiry;
    }

    mapping(string => MedicalRecord) private records;
    string[] private recordIds;

    event RecordUploaded(string indexed recordId, address indexed owner);
    event AccessGranted(
        string indexed recordId,
        address indexed doctor,
        uint256 expiry
    );
    event AccessRevoked(
        string indexed recordId,
        address indexed doctor,
        uint256 revokedAt
    );

    constructor() Ownable(msg.sender) {}

    /// @notice Upload a fully detailed medical record
    function uploadRecord(
        string memory recordId,
        // IPFS
        string[] memory _cids,
        // Patient
        string memory _name,
        uint8 _age,
        string memory _gender,
        // Summary
        string[] memory _conditions,
        string[] memory _allergies,
        string[] memory _medications,
        // Vitals
        string memory _bloodPressure,
        string memory _heartRate,
        string memory _temperature,
        // Recent Visit
        string memory _visitDate,
        string memory _visitReason,
        string memory _visitNotes,
        // Lab Result
        string memory _labTestName,
        string memory _labResultData,
        string memory _labDate,
        // Prescription
        string memory _prescriptionName,
        string memory _prescriptionDosage,
        string memory _prescribedDate,
        // Next Appointment
        string memory _nextAppointmentDate,
        string memory _nextAppointmentDoctor
    ) external {
        require(bytes(recordId).length > 0, "ID required");
        require(records[recordId].owner == address(0), "Already exists");

        MedicalRecord storage rec = records[recordId];

        // owner & CIDs
        rec.owner = msg.sender;
        for (uint i = 0; i < _cids.length; i++) {
            rec.cids.push(_cids[i]);
        }

        // patient
        rec.patientName = _name;
        rec.patientAge = _age;
        rec.patientGender = _gender;

        // summary
        for (uint i = 0; i < _conditions.length; i++) {
            rec.conditions.push(_conditions[i]);
        }
        for (uint i = 0; i < _allergies.length; i++) {
            rec.allergies.push(_allergies[i]);
        }
        for (uint i = 0; i < _medications.length; i++) {
            rec.medications.push(_medications[i]);
        }

        // vitals
        rec.bloodPressure = _bloodPressure;
        rec.heartRate = _heartRate;
        rec.temperature = _temperature;

        // recent visit
        rec.recentVisitDate = _visitDate;
        rec.visitReason = _visitReason;
        rec.visitNotes = _visitNotes;

        // lab
        rec.labTestName = _labTestName;
        rec.labResultData = _labResultData;
        rec.labDate = _labDate;

        // prescription
        rec.prescriptionName = _prescriptionName;
        rec.prescriptionDosage = _prescriptionDosage;
        rec.prescribedDate = _prescribedDate;

        // next appointment (pass empty strings if none)
        rec.nextAppointmentDate = _nextAppointmentDate;
        rec.nextAppointmentDoctor = _nextAppointmentDoctor;

        recordIds.push(recordId);
        emit RecordUploaded(recordId, msg.sender);
    }

    /// @notice Read the full record in one call
    function getRecord(
        string memory recordId
    )
        external
        view
        returns (
            //  0
            string[] memory cids,
            //  1–3
            string memory name,
            uint8 age,
            string memory gender,
            // 4–6
            string[] memory conditions,
            string[] memory allergies,
            string[] memory medications,
            // 7–9
            string memory bloodPressure,
            string memory heartRate,
            string memory temperature,
            // 10–12
            string memory visitDate,
            string memory visitReason,
            string memory visitNotes,
            // 13–15
            string memory labTestName,
            string memory labResultData,
            string memory labDate,
            // 16–18
            string memory prescriptionName,
            string memory prescriptionDosage,
            string memory prescribedDate,
            // 19–20
            string memory nextAppointmentDate,
            string memory nextAppointmentDoctor,
            // 21
            address ownerAddress
        )
    {
        MedicalRecord storage rec = records[recordId];
        require(rec.owner != address(0), "Not found");

        return (
            rec.cids,
            rec.patientName,
            rec.patientAge,
            rec.patientGender,
            rec.conditions,
            rec.allergies,
            rec.medications,
            rec.bloodPressure,
            rec.heartRate,
            rec.temperature,
            rec.recentVisitDate,
            rec.visitReason,
            rec.visitNotes,
            rec.labTestName,
            rec.labResultData,
            rec.labDate,
            rec.prescriptionName,
            rec.prescriptionDosage,
            rec.prescribedDate,
            rec.nextAppointmentDate,
            rec.nextAppointmentDoctor,
            rec.owner
        );
    }

    // (Your existing grantAccess, revokeAccess, checkAccessExpiry stay exactly the same)
    function grantAccess(
        string memory recordId,
        address doctor,
        uint256 duration
    ) external {
        /* … */
    }

    function revokeAccess(string memory recordId, address doctor) external {
        /* … */
    }

    function checkAccessExpiry(
        string memory recordId,
        address doctor
    ) external view returns (uint256) {
        /* … */
    }
}
